import React, { useState } from 'react';
import { NavBar } from './NavBar.js';
import { Header } from './Header.js';
import { Footer } from './Footer.js';
import { EditProfile } from './EditProfile.js';
import { SignIn } from './SignIn.js';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Teams } from './Teams';
import { Dashboard } from './Home.js';
import { Compatability } from './compatability.js';
import { ProfileCard } from './ProfileCard.js';
import '../../src/index.css';

export default function App() {
    const [profile, setProfile] = useState({
        name: 'Name',
        pronouns: 'Pronouns',
        mbti: 'MBTI',
        petpeeve: 'Pet Peeve',
        hobby: 'Hobby',
        favsong: 'Favorite Song',
    });

    const mbtiOption = [
        { value: "INTJ", label: "INTJ" },
        { value: "INTP", label: "INTP" },
        { value: "ENTJ", label: "ENTJ" },
        { value: "ENTP", label: "ENTP" },
        { value: "INFJ", label: "INFJ" },
        { value: "INFP", label: "INFP" },
        { value: "ENFJ", label: "ENFJ" },
        { value: "ENFP", label: "ENFP" },
        { value: "ISTJ", label: "ISTJ" },
        { value: "ISFJ", label: "ISFJ" },
        { value: "ESTJ", label: "ESTJ" },
        { value: "ESFJ", label: "ESFJ" },
        { value: "ISTP", label: "ISTP" },
        { value: "ISFP", label: "ISFP" },
        { value: "ESTP", label: "ESTP" },
        { value: "ESFP", label: "ESFP" }
    ];

    const [firstTwoTeams, setFirstTwoTeams] = useState([]);

    return (
        <div>
            <NavBar />
            <Header />
            <Routes>
                <Route path="/editProfile" element={<EditProfile profile={profile} setProfile={setProfile} mbtiOption={mbtiOption} />} />
                <Route path="/profile" element={<ProfileCard profile={profile} firstTwoTeams={firstTwoTeams} />} />
                <Route path="/" element={<SignIn />} />
                <Route path="/home" element={<Dashboard firstTwoTeams={firstTwoTeams}/>} />
                <Route path="/teams" element={<Teams setFirstTwoTeams={setFirstTwoTeams} profile={profile} setProfile={setProfile} />} />
                <Route path="/teams/:teamName" element={<Teams profile={profile} setProfile={setProfile} />} />
                <Route path="/compatability" element={<Compatability />} />
            </Routes>
            <Footer />
        </div>
    );
}
